  return (
    <div className="App">
      <form action="">
        <h2>Product Manager</h2>
        <div className="mainContainer">
          <div className="input1">
            <label>Title</label>
            <input type="text" onChange={(e) => setTitle(e.target.value)} />
          </div>
          <div className="input2">
            <label>Price</label>
